import React, { createContext } from 'react'

const PageData = createContext()

function PageDataContext (props){

  console.log(props)
  return (
    <PageData.Provider value={'asdf'}>
      {this.props.children}
    </PageData.Provider>
  )
}

export default PageDataContext
